import './travel.scss'
import TravelMap from '../TravelMap/TravelMap'
import {travelmapData} from '../../travelmapData'

export default class Travel extends Component {




    render() {
        // console.log(this.state.journeys)
        state = {
            travelmaps: travelmapData
        };
        return (
            <div className="backgroundColor2">
                <div className="qualitylist">
                    <div class="sectionHeader2">
                        <span class="header2 ver1">
                            <strong>My game plan</strong>
                        </span>
		            </div>
                </div>

                <section className="qualitylist">
                {
                    travelmaps.map(travelmap => (<TravelMap key= { travelmap.id } travelmap = { travelmap } />))
                }

                </section>
            </div> 

        )
    }
}
